import React from 'react'
import DatePicker from './DatePicker'

class Compare extends React.Component {
    constructor(props) {
        super(props);
        this.state = {date: ''};
    }
    render() {
        return (
            <div className="container">
                <DatePicker date={this.state.date}/>
                <h1>{this.props.apikey}</h1>
                
            </div>
        )
    }
}

export default Compare;
